import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Card,
  CardContent,
  Button,
  Chip,
  Grid,
  CircularProgress,
  Alert,
  Avatar,
  IconButton,
  Tooltip,
  Divider,
  Stack
} from '@mui/material';
import {
  Psychology,
  PlayArrow,
  Favorite,
  Share,
  AutoAwesome,
  TrendingUp,
  Explore,
  MusicNote,
  Refresh
} from '@mui/icons-material';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';
import { usePlayer } from '../contexts/PlayerContext';
import AudioPlayer from './AudioPlayer';

const AIRecommendations = () => {
  const { user } = useAuth();
  const { playTrack } = usePlayer();
  const [recommendations, setRecommendations] = useState([]);
  const [trending, setTrending] = useState([]);
  const [discoveries, setDiscoveries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeTab, setActiveTab] = useState('recommendations');
  const [refreshing, setRefreshing] = useState(false);

  useEffect(() => {
    if (user) {
      fetchAIContent();
    }
  }, [user]);

  const fetchAIContent = async () => {
    try {
      setLoading(true);
      setError(null);

      // Fetch AI recommendations, trending, and discoveries in parallel
      const [recsResponse, trendingResponse, discoveryResponse] = await Promise.all([
        axios.get('/api/ai/recommendations?limit=15'),
        axios.get('/api/ai/trending?period=weekly'),
        axios.get('/api/ai/discover?type=new_releases')
      ]);

      setRecommendations(recsResponse.data.recommendations || []);
      setTrending(trendingResponse.data.trending || []);
      setDiscoveries(discoveryResponse.data.tracks || []);

    } catch (error) {
      console.error('‚ùå Error fetching AI content:', error);
      setError('Failed to load AI recommendations. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const refreshRecommendations = async () => {
    setRefreshing(true);
    await fetchAIContent();
    setRefreshing(false);
  };

  const handlePlayTrack = (track, trackList) => {
    playTrack(track, trackList);
  };

  const generateSmartPlaylist = async (mood) => {
    try {
      console.log(`üéµ Generating ${mood} playlist...`);

      const response = await axios.post('/api/ai/playlist/generate', {
        mood,
        duration: 60,
        genres: []
      });

      if (response.data.success) {
        alert(`‚ú® Created AI playlist: "${response.data.playlist.name}"!`);
        // Could navigate to playlist or show in player
      }

    } catch (error) {
      console.error('‚ùå Playlist generation error:', error);
      alert('Failed to generate playlist. Please try again.');
    }
  };

  if (loading) {
    return (
      <Box sx={{ textAlign: 'center', py: 6 }}>
        <CircularProgress sx={{ color: '#667eea' }} />
        <Typography variant="h6" sx={{ mt: 2, color: '#ccc' }}>
          ü§ñ AI is curating your personalized music experience...
        </Typography>
      </Box>
    );
  }

  if (error) {
    return (
      <Alert 
        severity="error" 
        sx={{ mb: 3 }}
        action={
          <Button color="inherit" size="small" onClick={fetchAIContent}>
            Retry
          </Button>
        }
      >
        {error}
      </Alert>
    );
  }

  return (
    <Box sx={{ py: 2 }}>
      {/* Real AI Header */}
      <Box sx={{ mb: 4, textAlign: 'center' }}>
        <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', mb: 2 }}>
          <Psychology sx={{ fontSize: 40, color: '#667eea', mr: 2 }} />
          <Typography variant="h4" sx={{ fontWeight: 'bold', color: 'white' }}>
            Real AI Music Discovery
          </Typography>
          <AutoAwesome sx={{ fontSize: 40, color: '#ffd700', ml: 2 }} />
        </Box>
        <Stack direction="row" spacing={1} justifyContent="center" sx={{ mb: 2 }}>
          <Chip 
            label="ü§ñ Real AI Powered" 
            sx={{ bgcolor: '#4caf50', color: 'white', fontWeight: 'bold' }}
          />
          <Chip 
            label="üß† Hugging Face Models" 
            sx={{ bgcolor: '#667eea', color: 'white' }}
          />
          <Chip 
            label="üéØ Semantic Analysis" 
            sx={{ bgcolor: '#ff9800', color: 'white' }}
          />
        </Stack>
        <Typography variant="body1" sx={{ color: '#ccc', maxWidth: 600, mx: 'auto' }}>
          Powered by genuine machine learning models for semantic music understanding, 
          personalized recommendations, and intelligent content discovery.
        </Typography>
        <Button
          variant="outlined"
          startIcon={refreshing ? <CircularProgress size={20} /> : <Refresh />}
          onClick={refreshRecommendations}
          disabled={refreshing}
          sx={{ 
            mt: 2,
            borderColor: '#667eea',
            color: '#667eea',
            '&:hover': { borderColor: '#764ba2', color: '#764ba2' }
          }}
        >
          {refreshing ? 'Refreshing...' : 'Refresh AI Recommendations'}
        </Button>
      </Box>

      {/* Quick Playlist Generation */}
      <Card sx={{ bgcolor: '#1a1a1a', mb: 4, border: '1px solid #667eea' }}>
        <CardContent>
          <Typography variant="h6" sx={{ color: 'white', mb: 2, display: 'flex', alignItems: 'center' }}>
            <AutoAwesome sx={{ mr: 1, color: '#ffd700' }} />
            Instant AI Playlists
          </Typography>
          <Typography variant="body2" sx={{ color: '#ccc', mb: 3 }}>
            Generate perfect playlists in seconds based on your mood
          </Typography>
          <Stack direction="row" spacing={1} flexWrap="wrap" useFlexGap>
            {['Happy', 'Chill', 'Energetic', 'Focus', 'Romantic', 'Sad'].map((mood) => (
              <Button
                key={mood}
                variant="outlined"
                size="small"
                onClick={() => generateSmartPlaylist(mood.toLowerCase())}
                sx={{
                  borderColor: '#667eea',
                  color: '#667eea',
                  '&:hover': { 
                    borderColor: '#764ba2', 
                    color: '#764ba2',
                    bgcolor: 'rgba(102, 126, 234, 0.1)'
                  }
                }}
              >
                {mood} Mix
              </Button>
            ))}
          </Stack>
        </CardContent>
      </Card>

      {/* Navigation Tabs */}
      <Box sx={{ mb: 3 }}>
        <Stack direction="row" spacing={2}>
          {[
            { id: 'recommendations', label: 'For You', icon: <Psychology />, count: recommendations.length },
            { id: 'trending', label: 'Trending', icon: <TrendingUp />, count: trending.length },
            { id: 'discover', label: 'Discover', icon: <Explore />, count: discoveries.length }
          ].map((tab) => (
            <Button
              key={tab.id}
              variant={activeTab === tab.id ? 'contained' : 'outlined'}
              startIcon={tab.icon}
              onClick={() => setActiveTab(tab.id)}
              sx={{
                bgcolor: activeTab === tab.id ? '#667eea' : 'transparent',
                borderColor: '#667eea',
                color: activeTab === tab.id ? 'white' : '#667eea',
                '&:hover': { 
                  bgcolor: activeTab === tab.id ? '#764ba2' : 'rgba(102, 126, 234, 0.1)',
                  borderColor: '#764ba2'
                }
              }}
            >
              {tab.label} ({tab.count})
            </Button>
          ))}
        </Stack>
      </Box>

      {/* Recommendations Tab */}
      {activeTab === 'recommendations' && (
        <Box>
          <Typography variant="h5" sx={{ color: 'white', mb: 3, display: 'flex', alignItems: 'center' }}>
            <Psychology sx={{ mr: 2, color: '#667eea' }} />
            Personalized For You
          </Typography>

          {recommendations.length === 0 ? (
            <Card sx={{ bgcolor: '#1e1e1e', textAlign: 'center', py: 6 }}>
              <CardContent>
                <MusicNote sx={{ fontSize: 64, color: '#ccc', mb: 2 }} />
                <Typography variant="h6" sx={{ color: '#ccc', mb: 2 }}>
                  Start listening to get personalized recommendations!
                </Typography>
                <Typography variant="body2" sx={{ color: '#888' }}>
                  Play some tracks to help our AI learn your music taste
                </Typography>
              </CardContent>
            </Card>
          ) : (
            <Grid container spacing={2}>
              {recommendations.map((track, index) => (
                <Grid item xs={12} key={track.id}>
                  <Card sx={{ 
                    bgcolor: '#1e1e1e', 
                    '&:hover': { bgcolor: '#2a2a2a' },
                    border: track.aiScore > 0.8 ? '1px solid #667eea' : 'none'
                  }}>
                    <CardContent sx={{ py: 2 }}>
                      <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                        <Avatar
                          sx={{ 
                            bgcolor: '#667eea',
                            width: 50,
                            height: 50,
                            fontSize: '1.2rem'
                          }}
                        >
                          {index + 1}
                        </Avatar>

                        <Box sx={{ flex: 1, minWidth: 0 }}>
                          <Typography variant="h6" sx={{ color: 'white', noWrap: true }}>
                            {track.title}
                          </Typography>
                          <Typography variant="body2" sx={{ color: '#ccc' }}>
                            by {track.artist}
                          </Typography>
                          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mt: 1 }}>
                            <Chip
                              size="small"
                              label={`AI Match: ${Math.round(track.aiScore * 100)}%`}
                              sx={{ 
                                bgcolor: track.aiScore > 0.8 ? '#4caf50' : '#ff9800',
                                color: 'white',
                                fontSize: '0.75rem'
                              }}
                            />
                            {track.genre && (
                              <Chip
                                size="small"
                                label={track.genre}
                                variant="outlined"
                                sx={{ color: '#ccc', borderColor: '#555' }}
                              />
                            )}
                          </Box>
                          {track.aiReason && (
                            <Typography variant="caption" sx={{ color: '#888', mt: 0.5, display: 'block' }}>
                              ü§ñ {track.aiReason}
                            </Typography>
                          )}
                        </Box>

                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                          <Tooltip title="Play Track">
                            <IconButton
                              onClick={() => handlePlayTrack(track, recommendations)}
                              sx={{ color: '#667eea' }}
                            >
                              <PlayArrow />
                            </IconButton>
                          </Tooltip>
                          <Tooltip title="Like">
                            <IconButton sx={{ color: '#ff4757' }}>
                              <Favorite />
                            </IconButton>
                          </Tooltip>
                          <Tooltip title="Share">
                            <IconButton sx={{ color: '#ccc' }}>
                              <Share />
                            </IconButton>
                          </Tooltip>
                        </Box>
                      </Box>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          )}
        </Box>
      )}

      {/* Trending Tab */}
      {activeTab === 'trending' && (
        <Box>
          <Typography variant="h5" sx={{ color: 'white', mb: 3, display: 'flex', alignItems: 'center' }}>
            <TrendingUp sx={{ mr: 2, color: '#4caf50' }} />
            Trending This Week
          </Typography>

          <Grid container spacing={2}>
            {trending.slice(0, 10).map((track, index) => (
              <Grid item xs={12} key={track.id}>
                <Card sx={{ 
                  bgcolor: '#1e1e1e',
                  '&:hover': { bgcolor: '#2a2a2a' },
                  border: index < 3 ? '1px solid #4caf50' : 'none'
                }}>
                  <CardContent sx={{ py: 2 }}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                      <Avatar
                        sx={{ 
                          bgcolor: index < 3 ? '#4caf50' : '#667eea',
                          width: 50,
                          height: 50,
                          fontSize: '1.2rem'
                        }}
                      >
                        {index + 1}
                      </Avatar>

                      <Box sx={{ flex: 1 }}>
                        <Typography variant="h6" sx={{ color: 'white' }}>
                          {track.title}
                        </Typography>
                        <Typography variant="body2" sx={{ color: '#ccc' }}>
                          by {track.artist}
                        </Typography>
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mt: 1 }}>
                          <Chip
                            size="small"
                            label={require('../utils/format').formatPlays(track.play_count || 0)}
                            sx={{ bgcolor: '#4caf50', color: 'white' }}
                          />
                          <Chip
                            size="small"
                            label={`${track.likes || 0} likes`}
                            sx={{ bgcolor: '#ff4757', color: 'white' }}
                          />
                        </Box>
                      </Box>

                      <IconButton
                        onClick={() => handlePlayTrack(track, trending)}
                        sx={{ color: '#4caf50' }}
                      >
                        <PlayArrow />
                      </IconButton>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Box>
      )}

      {/* Discover Tab */}
      {activeTab === 'discover' && (
        <Box>
          <Typography variant="h5" sx={{ color: 'white', mb: 3, display: 'flex', alignItems: 'center' }}>
            <Explore sx={{ mr: 2, color: '#ff9800' }} />
            Fresh Discoveries
          </Typography>

          <Grid container spacing={3}>
            {discoveries.map((track) => (
              <Grid item xs={12} sm={6} md={4} key={track.id}>
                <Card sx={{ 
                  bgcolor: '#1e1e1e',
                  '&:hover': { bgcolor: '#2a2a2a', transform: 'translateY(-2px)' },
                  transition: 'all 0.2s ease'
                }}>
                  <CardContent>
                    <Typography variant="h6" sx={{ color: 'white', mb: 1, noWrap: true }}>
                      {track.title}
                    </Typography>
                    <Typography variant="body2" sx={{ color: '#ccc', mb: 2 }}>
                      by {track.artist}
                    </Typography>

                    {track.aiReason && (
                      <Typography variant="caption" sx={{ 
                        color: '#ff9800',
                        display: 'block',
                        mb: 2,
                        fontStyle: 'italic'
                      }}>
                        üí° {track.aiReason}
                      </Typography>
                    )}

                    <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                      <Chip
                        size="small"
                        label={track.genre || 'Unknown'}
                        variant="outlined"
                        sx={{ color: '#ccc', borderColor: '#555' }}
                      />
                      <IconButton
                        onClick={() => handlePlayTrack(track, discoveries)}
                        sx={{ color: '#ff9800' }}
                      >
                        <PlayArrow />
                      </IconButton>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Box>
      )}
    </Box>
  );
};

export default AIRecommendations;
